				biography: "<p>高中開始便喜歡動手實作，赤手空拳進入技職院校胡搞瞎搞。<br/>夢想讓工匠精神遍地開花，近期則不安於待在地球表面想讓任何事物飛上天，透過自行開發的開源微型多軸學習平台，期能讓更多人享受飛翔的美妙，有朝一日能真正落實無人機在社會的各項應用。<br/></p><p>ArkLab多旋翼工坊 -創辦人<br/>NFU.Dream.Maker 技術社群 -共同創辦人<br/></p>"
